import React, { useState } from "react";

 const App = () => {

  const [fname,setFname]= useState("");
  const [lname,setLname]= useState("");
  const [passwd,setPasswd]= useState("");
  const [data,setData] = useState([]);


    const onsubmit = (e) =>{
      e.preventDefault();
      const data = {firstName : fname , lastName : lname, Password : passwd}
      setData([data]);
    }
   return(
     <>
     <form onSubmit={onsubmit}>
      <div>
        <h2> Users Data:</h2>

        <input type="text" placeholder="Enter your first Name"  value={fname} onChange={(e) => setFname(e.target.value)}/><br/><br/>
        <input type="text" placeholder="Enter your last Name"  value={lname} onChange={(e) => setLname(e.target.value)}></input><br/><br/>
        <input type="password" placeholder="Enter Password" value={passwd} onChange={(e) => setPasswd(e.target.value)}></input><br/><br/>
        <input type="submit" placeholder="submit" onClick={onsubmit}></input>
        <br/>
        </div>
        </form>


        {
        data.map((inputs)=>{
          return(
            <>
              <table>
                <tr>
                  <th>Month</th>
                  <th>Savings</th>
                </tr>
                   <tr>
    <td>January</td>
    <td>$100</td>
  </tr>
  <tr>
    <td>February</td>
    <td>$80</td>
  </tr>
</table>
            <p>Name:{inputs.firstName}</p>
            <p>Lastname:{inputs.lastName}</p>
            <p>Password:{inputs.Password}</p>
            </>
          )
        })  
        }
     </>
   );
 }

 export default App
